const now = new Date();

const year = now.getFullYear();
const month = String(now.getMonth() + 1).padStart(2, '0'); // months are 0-based
const day = String(now.getDate()).padStart(2, '0'); 

const formattedDate = `${year}${month}${day}`;

// Assume each purchase request has a 'created_at' property
const purchaseRequests = collections[/* competitions */ 'fd388b7d-94ab-460f-bb43-cfe9983cf7b4']?.['data'] || [];

// Get today's date in YYYY-MM-DD format
const today = new Date().toISOString().slice(0, 10);

// Filter requests created today
const todaysRequests = purchaseRequests.filter(req => 
  req.created_at?.slice(0, 10) === today
);

// Count how many exist today
const countToday = todaysRequests.length;

letter = String.fromCharCode(65 + countToday);

return formattedDate + letter;

